import { useState } from 'react';

const Homepage = () => {

    let name = 'mario';
    const [] = useState('mario');

    const handleClick = function () {
        name = 'luigi';
    }

    return (
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click me</button>
            <p>{name}</p>
        </div>
    );
}

export default Homepage;
